import React from 'react'
import './chat.css';

const Chat = () => {
  return (
    <div className='Chat'>
        {/* Left Side */}
        <div className="Left-side-chat">
            <h2>Chats</h2>
            <div className="Chat-list">
                Conversation Header
            </div>
        </div>

        {/* Right Side */}
        <div className="Right-side-chat">
            Rigth Side
        </div>
    </div>
  )
}

export default Chat
